import React from 'react';
import {
    GridItemContainer,
    ContentContainer,
    GridText,
    GridImg
} from './GridItemElements';

const GridItem = ({ id, itemText, itemSVG }) => {
    return (
        <>
            <GridItemContainer id={id}>
                <ContentContainer>
                    <GridText>{itemText}</GridText>
                    <GridImg src={itemSVG} />
                </ContentContainer>
            </GridItemContainer>
        </>
    )
}

export default GridItem;
